# NEW WRAPPER FUNCTION (The "Adapter")
# ==============================================================================
def get_visibility_from_triangulation(
    viewpoint: Tuple[float, float],
    delaunator_data: DelaunatorLike,
    obstructs_func: Callable[[int], bool]
) -> Polygon:
    """
    Calculates the visibility polygon using the pre-computed triangulation.
    This function replaces the old 'cast_rays_with_holes'.
    """
    qx, qy = viewpoint
    
    # 1. Run the fast triangular expansion algorithm
    visibility_segments = triangular_expansion(delaunator_data, qx, qy, obstructs_func)
    
    if not visibility_segments:
        return Polygon()  # Return an empty polygon if viewpoint is outside or sees nothing

    # 2. Convert the visible segments into a list of triangular Polygon "wedges"
    visible_triangles = []
    for seg in visibility_segments:
        # A segment is (slx, sly, srx, sry)
        triangle_coords = [viewpoint, (seg[0], seg[1]), (seg[2], seg[3])]
        visible_triangles.append(Polygon(triangle_coords))

    if not visible_triangles:
        return Polygon()

    # 3. Union all the small triangles into one large visibility polygon
    #    This is the same as the final output from the old ray-casting method.
    return unary_union(visible_triangles).simplify(TOLERANCE, preserve_topology=True)


