def get_windows(polygon, vis_polygon):
    """
    Finds visibility windows (frontiers) based on the *total shared map*.
    This version is FASTER and IGNORES enclosed "islands".
    """
    
    clean_vis_polygon = vis_polygon.simplify(TOLERANCE, preserve_topology=True)
    if clean_vis_polygon.is_empty:
        return LineString()

    # --- START NEW LOGIC ---
    # This logic IGNORES interior "islands"
    polygons_to_process = []
    if clean_vis_polygon.geom_type == 'Polygon':
        polygons_to_process = [clean_vis_polygon]
    elif clean_vis_polygon.geom_type == 'MultiPolygon':
        polygons_to_process = list(clean_vis_polygon.geoms)

    exterior_lines = []
    for poly in polygons_to_process:
        if not poly.exterior.is_empty:
            exterior_lines.append(poly.exterior)
    
    if not exterior_lines:
        return LineString()

    multi_line_vis = unary_union(exterior_lines)
    # --- END NEW LOGIC ---

    environment_lines = polygon.boundary
    buffered_environment = environment_lines.buffer(TOLERANCE)
    
    window_segments = multi_line_vis.difference(buffered_environment)
    return window_segments
