class Drone:
    """A class to represent a single mobile drone with its own state."""
    def __init__(self, drone_id, initial_pos):
        self.id = drone_id
        self.pos = initial_pos
        self.status = 'available'
        self.parent = None
        self.vis_poly = None

    def __repr__(self):
        pos_str = f"({self.pos[0]:.2f}, {self.pos[1]:.2f})"
        return f"Drone {self.id} @ {pos_str} ({self.status})"

def update_plot(ax, polygon, drone_fleet, shared_map, title_text, frontiers=None, evaluated_tasks=None, winning_task=None):
    """Clears and redraws the Matplotlib plot with enhanced information."""
    ax.clear()
    
    # zorder 0: Base environment fill
    ox, oy = polygon.exterior.xy
    ax.fill(ox, oy, color='lightgray', zorder=0)

    # zorder 1 & 2: Explored area (yellow) and its "holes"
    if shared_map.is_empty:
        polygons_to_plot = []
    elif shared_map.geom_type == 'Polygon':
        polygons_to_plot = [shared_map]
    elif shared_map.geom_type == 'MultiPolygon':
        polygons_to_plot = list(shared_map.geoms)
    # --- ADDED THIS CHECK ---
    # Handle the rare case where shared_map degenerates.
    # We can't plot the "fill" of a LineString or Point.
    else: 
        polygons_to_plot = [] 
    # --- END ADDED CHECK ---

    for i, poly in enumerate(polygons_to_plot):
        if poly.is_empty: continue
        
        # --- THE MAIN FIX ---
        # Only try to fill geometries that are Polygons
        if poly.geom_type == 'Polygon':
            # Plot the exterior (the yellow part) at zorder=1
            vx, vy = poly.exterior.xy
            ax.fill(vx, vy, color='gold', alpha=0.5, label='Total Coverage' if i == 0 else '_nolegend_', zorder=1)
            
            # Plot the interiors (punching out the holes) at zorder=2
            for interior in poly.interiors:
                ix, iy = interior.xy
                ax.fill(ix, iy, color='lightgray', zorder=2)
        # --- END FIX ---

    # zorder 3: Environment hole (obstacle) fills
    for interior in polygon.interiors:
        hx, hy = interior.xy
        ax.fill(hx, hy, color='dimgray', zorder=3)
        
    # zorder 4: Environment boundaries (exterior AND holes)
    ax.plot(ox, oy, 'k-', linewidth=1, zorder=4)
    for interior in polygon.interiors:
        hx, hy = interior.xy
        ax.plot(hx, hy, 'k-', linewidth=1, zorder=4)
        
    # zorder 5: Network links
    for i, drone in enumerate(drone_fleet):
        if drone.status == 'stationary' and drone.parent:
            p_pos, c_pos = drone.parent.pos, drone.pos
            ax.plot([p_pos[0], c_pos[0]], [p_pos[1], c_pos[1]], 'k-', linewidth=1.5, zorder=5, label='Network Link' if i == 1 else '_nolegend_')
    
    stationary_nodes = [d for d in drone_fleet if d.status == 'stationary']
    if stationary_nodes:
        exploring_drones = [d for d in drone_fleet if d.status == 'exploring']
        for i, drone in enumerate(exploring_drones):
            exploring_pos_point = Point(drone.pos)
            visible_stationary_parents = [s for s in stationary_nodes if s.vis_poly and s.vis_poly.buffer(TOLERANCE).contains(exploring_pos_point)]
            if visible_stationary_parents:
                closest_visible_parent = min(visible_stationary_parents, key=lambda s: Point(s.pos).distance(exploring_pos_point))
                p_pos, c_pos = closest_visible_parent.pos, drone.pos
                ax.plot([p_pos[0], c_pos[0]], [p_pos[1], c_pos[1]], 'gray', linestyle=':', linewidth=1, zorder=5, label='Exploring Link' if i == 0 else '_nolegend_')
    
    # zorder 6: Frontiers
    if frontiers:
        if frontiers.geom_type == 'MultiLineString':
            for i, frontier in enumerate(frontiers.geoms):
                x, y = frontier.xy
                ax.plot(x, y, 'c--', linewidth=2, label='Frontiers' if i == 0 else '_nolegend_', zorder=6)
        elif frontiers.geom_type == 'LineString':
             x, y = frontiers.xy
             ax.plot(x, y, 'c--', linewidth=2, label='Frontiers', zorder=6)

    # zorder 7: Evaluated tasks text
    if evaluated_tasks:
        for task in evaluated_tasks:
            ax.text(task['pos'][0], task['pos'][1] + 0.3, f"{task['gain']:.1f}", color='blue', fontsize=9, ha='center', fontweight='bold', zorder=7)
    
    # zorder 8: Winning task frontier
    if winning_task and frontiers:
        winning_point = Point(winning_task['pos'])
        all_frontiers = list(frontiers.geoms) if frontiers.geom_type == 'MultiLineString' else [frontiers]
        for frontier in all_frontiers:
            if frontier.interpolate(0.5, normalized=True).equals_exact(winning_point, 1e-6):
                x, y = frontier.xy
                ax.plot(x, y, color='gold', linestyle='-', linewidth=4, zorder=8, label='Winning Frontier')
                break
                
    # zorder 9 & 10: Drones
    for drone in drone_fleet:
        if drone.status == 'stationary': color, marker, size, label = 'red', 'o', 10, 'Stationary Drone'
        elif drone.status == 'exploring': color, marker, size, label = 'blue', 's', 8, 'Exploring Drone'
        else: color, marker, size, label = 'dimgray', 'x', 6, 'Available Drone'
        ax.plot(drone.pos[0], drone.pos[1], marker, color=color, markersize=size, label=label, zorder=9)
        ax.text(drone.pos[0] + 0.2, drone.pos[1] + 0.2, f'D{drone.id}', color=color, fontsize=10, fontweight='bold', zorder=10)
    
    ax.set_aspect('equal', 'box')
    ax.grid(True, linestyle='--', alpha=0.6)
    ax.set_title(title_text, fontsize=16)
    
    handles, labels = ax.get_legend_handles_labels()
    by_label = dict(zip(labels, handles))
    ax.legend(by_label.values(), by_label.keys(), loc='upper right')
    
    plt.draw()
    plt.pause(0.1)

